def exportTexture(id):
	id = id.upper()
	if id not in tempFiles:
		decompressDatablock(id)
	path1 = tempFiles[id]['dir']
	fileName = tempFiles[id]['fileName']
	path2 = dumpFolder + os.sep + fileName + '.dds'
	if os.path.isfile(path2):
		return
	fi = open(path1, 'rb')
	_ = fi.read(14)
	num1 = fi.read(4)
	num2 = fi.read(4)
	_ = fi.read(4)
	imgDXT = LE2DEC2(fi.read(4))
	_ = fi.read(8)
	num3 = fi.read(4)
	_ = fi.read(84)
	count = fi.read(4)
	buffer = fi.read(LE2DEC2(count))
	
	fi.close()
	

	fi = open(path2, 'wb')
	fi.write('DDS ')
	fi.write('\x7C\x00\x00\x00\x07\x10\x0A\x00')
	fi.write(num2)
	fi.write(num1)
	fi.write(count)
	fi.write('\x00\x00\x00\x00')
	fi.write(num3)
	for index in range(11):
		fi.write('\x00\x00\x00\x00')
	fi.write('\x20\x00\x00\x00')
	if imgDXT == 0 or imgDXT == 7:
		fi.write('\x40\x00\x00\x00')
	else:
		fi.write('\x04\x00\x00\x00')
	if imgDXT in [0, 7]:
		fi.write('\x44\x58\x54\x30') #DXT0
	elif imgDXT in [1, 2, 3]:
		fi.write('\x44\x58\x54\x31') #DXT1
	elif imgDXT == 4:
		fi.write('\x44\x58\x54\x33') #DXT3
	elif imgDXT == 5:
		fi.write('\x44\x58\x54\x35') #DXT5
	elif imgDXT == 8:
		fi.write('\x44\x58\x31\x30') #DX10
		
	for index in range(5):
		fi.write('\x00\x00\x00\x00')
	fi.write('\x08\x10\x40\x00')
	for index in range(4):
		fi.write('\x00\x00\x00\x00')
	if imgDXT == 8:
		fi.write('\x62\x00\x00\x00')
		fi.write('\x03\x00\x00\x00')
		fi.write('\x00\x00\x00\x00')
		fi.write('\x01\x00\x00\x00')
		fi.write('\x00\x00\x00\x00')
	fi.write(buffer)
	fi.close()
	if imgDXT == 8:
		texconv = config["texconv"] + " "
		# else
		# {
			# str4 = arxForm.tempDir + "\\" + tNode.Parent.Parent.Parent.Text + "\\dx9_";
			# path2 = arxForm.tempDir + "\\" + tNode.Parent.Parent.Parent.Text + "\\dx9_" + tNode.Text + "." + strArray3[1];
		# }
		arguments = "-fl 9.1 -px " + dumpFolder + os.sep + " -f BC3_UNORM " + path2
		os.system(texconv+arguments)
	
def exportDataBlock(id):
	f = open(config["temp"], 'w')
	if id not in tempFiles:
		decompressDatablock(id.upper())
	path1 = tempFiles[id]['dir']
	fi = open(path1, 'rb')
	_ = fi.read(10)
	if LE2BE2(fi.read(4)).upper() != 'AC2BBF68':
		return
	count = LE2DEC2(fi.read(4))
	fileIDList = {}
	ticker = 0
	for n in range(count):
		_ = fi.read(2)
		id2 = BEHEX2(fi.read(8)).upper()
		# print str(id2) + '\t\t' + tempFiles[id2]['fileName']
		# print tempFiles[id2]['resourceType']
		if id2 not in tempFiles:
			decompressDatablock(id2.upper())
		
		f.write(id2 +'\t'+ tempFiles[id2]['fileName'] +'\t'+ tempFiles[id2]['resourceType'] +'\n')
		if tempFiles[id2]['resourceType'] == '0984415E':
			try:
				fileIDList[ticker] = exportData('0984415E', open(tempFiles[id2]['dir'], 'rb'), 0, returnLOD0 = True)[1]
				ticker += 1
			except:
				try:
					fileIDList[ticker] = exportData('0984415E2', open(tempFiles[id2]['dir'], 'rb'), 0, returnLOD0 = True)[1]
					ticker += 1
				except:
					continue
	exportOBJMulti(id, fileIDList)
			

