def loadData(id):
	popUp = Toplevel()
	popUp.title('Found')
	foundListScrollBar = Scrollbar(popUp)
	foundListScrollBar.pack(side=RIGHT, fill=Y)
	foundList = Listbox(popUp, yscrollcommand=foundListScrollBar.set)
	foundList.pack()
	foundListScrollBar.config(command=foundList.yview)
	buttonNo = 0
	for but in loadDataList:
		but.destroy()
	dictionary = open(config["dictionaryDoc"], 'r')
	for line in dictionary:
		if line[0:16] == id:
			idlist = eval(line.split(':::::')[1])
			for id2 in idlist[0]:
				button = Button(foundList, text = id2[1])
				loadDataList.append(button)
				# button.grid(row=buttonNo, column=0)
				button.pack()
				foundList.insert(END, button)
				buttonNo += 1
			for id2 in idlist[1]:
				button = Button(foundList, text = id2[1]+' - '+id2[2])
				loadDataList.append(button)
				# button.grid(row=buttonNo, column=0)
				button.pack()
				buttonNo += 1

def randomId():
	while True:
		try:
			id = random.choice(fileList[random.choice(fileList.keys())].keys()).upper()
		except:
			continue
		if id == '1000000000000000':
			continue
		if id not in tempFiles:
			decompressDatablock(id)
		# print tempFiles[id]['resourceType']
		if tempFiles[id]['resourceType'] == '415D9568':
			readModel(id)
			exportOBJ(id)
		else:
			continue
		return
	

